What is printed to console.log?

Promise.resolve({
    name: "Jane"
}).then(function (o) {
    o.job = "Heiress";
    return Promise.reject(o);
}).then(function (o) {
    o.school = "Uni";
    return o;
}).then(function(o) {
    o.pet = "Fido";
}).catch(function(o) {
    return o;
}).then(function (o) {
    console.log(o.name, o.job, o.school, o.pet);
}, function (o) {
    console.log(o.name, o.job);
});

